import React from 'react';

function App(){

  const sayHello = () => {
    console.log('hello');
  }

  const counter = 0;

  return (
    <div>
      <h1>Hello React</h1>
      <button onClick={sayHello}>Hello</button>
    </div>
  );
}


export default App;
